import Auth from "../components/auth-interface";
import Input from "../components/form-input";

const Login = () => (
    <div>
      <Auth title>
        <Input type="text" placeholder="Student ID#"/>
        <Input type="password" placeholder="Password"/>
      </Auth>
      
    </div>
  );

export default Login;
